app.controller("game-screen-clock",["$scope",function(a){var c;a.time={hours:1,minutes:0,seconds:0};a.$on("$destroy",function(){clearInterval(c)});function b(){c=setInterval(function(){a.time.seconds--;if(a.time.seconds<0){a.time.seconds=59;a.time.minutes--;if(a.time.minutes<0){a.time.minutes=59;a.time.hours--;if(a.time.hours<0){clearInterval(c);return}}}a.$apply()},1000)}b()}]);app.controller("game-screen-high",["$scope","$log",function(a,b){a.players=[{name:"Alex",points:90},{name:"Alex2",points:50},{name:"Alex3",points:30}]}]);app.controller("game-screen-ques",["$scope","$log",function(a,b){a.numOfQues=50}]);